    data: |
      pragma pg
      SELECT ALL 91 * - 8 AS col1 FROM tab2 WHERE NULL = ( + ( + - 11 ) ) GROUP BY col1, col2 HAVING NOT col1 >= - + col1 / + 34 + - + col1 * col2;
  - name: tab2

outputs:
